Республиканский этап Всероссийской Робототехнической олимпиады 2016, 2 место в состязании «Футбол», Усманов Данил, Евграфов Максим, ученики 9 класса;
Республиканский этап Всероссийской Робототехнической олимпиады 2016, 1 место в состязании «Сортировка отходов» (средняя возрастная группа), Якупов Салават, ученик 7 класса;
Заключительный этап Всероссийской робототехнической олимпиады 2016, 3 место в категории «Футбол роботов», Усманов Данил, Евграфов Максим, ученики 9 класса;
Чемпионат школьных команд по кибербезопасности Kaspersky CyberHeroes, финалисты, Иванов Никита, Лукьянов Кирилл, Попутников Георгий, ученики 10 класса;
Командная олимпиада школьников по программированию Республики Татарстан, диплом 3 степени, Иванов Никита, Рахимов Рим, Фатхуллин Ильшат, ученики 11 класса;
Соревнование школьных бизнес-проектов Школьного бизнес-инкубатора РТ в рамках Kazan StartUp Weekend в IT-парке г. Казань, лучший проект, ученики 11 класса ГАОУ «Лицей Иннополис» Иванов Никита и Рахимов Рим.
